import React, { Component } from "react";
import ArticleVideo from "./ArticleVideo";
import home from "../videos/HomePage.mp4";

export default class Youtube extends Component {
  render() {
    return (
      <div className="article-body max-width">
        <ArticleVideo
          videoSrc={home}
          videoDescription={
            "The new HomePage in action, with a better emphasis on recommendations. Hedjieodjeiodjeodijejeijdoedeionj"
          }
        />
      </div>
    );
  }
}
